import base64
import os.path


def set_icon(window):
    global icon_code
    path = 'icon_for_the_graph_of_the_adjacent_matrix.ico'
    if os.path.exists(path):
        os.remove(path)
    f = open(path, 'wb')
    f.write(base64.b64decode(icon_code))
    f.close()
    window.iconbitmap(path)
    os.remove(path)

icon_code = ''
